DROP TABLE IF EXISTS `t_csjk_wificsjkrs`;
CREATE TABLE `t_csjk_wificsjkrs` (
  `id` varchar(36) NOT NULL COMMENT 'id',
  `jkrs` int(11) DEFAULT NULL COMMENT '当天监控人数',
  `jksj` datetime DEFAULT NULL COMMENT '监控时间，每天',
  `cs_id` varchar(255) DEFAULT NULL COMMENT '监控场所id',
  PRIMARY KEY (`id`),
  KEY `index_t_csjk_wificsjkrs_cs_id` (`cs_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='场所监控人数';



/* 大数据替代                                           */
DROP TABLE IF EXISTS `t_csjk_wificscrxx`;
CREATE TABLE `t_csjk_wificscrxx` (
  `id` varchar(255) NOT NULL COMMENT 'id',
  `jrsj` datetime DEFAULT NULL COMMENT '进入时间',
  `sfzh` varchar(255) DEFAULT NULL COMMENT '身份证号',
  `cswd` varchar(255) DEFAULT NULL COMMENT '纬度，采用“正负+十进制度数”的格式表示。度数采用3位整数5位小数形式,小数位数不足补零，方位采用正负符号形式，使用正符号表示北纬（正符号省略），负符号表示南纬。例如123.23000 表示北纬123.2300度；-133.00000表示南纬133.00000度',
  `lksj` datetime DEFAULT NULL COMMENT '离开时间',
  `csjd` varchar(255) DEFAULT NULL COMMENT '经度，采用“正负+十进制度数”的格式表示。度数采用3位整数5位小数形式,小数位数不足补零，方位采用正负符号形式，使用正符号表示东经（正符号省略），负符号表示西经。例如123.23000 表示东经123.23000度；-133.00000表示西经133.00000度',
  `mac` varchar(17) DEFAULT NULL COMMENT 'mac地址',
  `sjhm` varchar(50) DEFAULT NULL COMMENT '手机号',
  `csmc` varchar(255) DEFAULT NULL COMMENT '场所名称',
  `csbm` varchar(255) DEFAULT NULL COMMENT '场所编码',
  `zlsc` int(11) DEFAULT NULL COMMENT '驻留时间，秒',
  `rylxbm` varchar(50) default NULL comment '人员类型编码',
  `qklxbm` varchar(50) default NULL comment '前科类型编码',
  `rymc` varchar(50) default NULL comment '人员名称',
  PRIMARY KEY (`id`),
  KEY `index_t_csjk_wificscrxx_jrsj` (`jrsj`),
  KEY `index_t_csjk_wificscrxx_sfzh` (`sfzh`),
  KEY `index_t_csjk_wificscrxx_mac` (`mac`),
  KEY `index_t_csjk_wificscrxx_sjhm` (`sjhm`),
  KEY `index_t_csjk_wificscrxx_csbm` (`csbm`),
  KEY `index_t_csjk_wificscrxx_rylxbm` (`rylxbm`),
  KEY `index_t_csjk_wificscrxx_qklxbm` (`qklxbm`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='wifi场所出入信息';


/*==============================================================*/
/* 大数据替代                                           */
/*==============================================================*/
DROP TABLE IF EXISTS `t_csjk_wificscrxx_rylx`;
CREATE TABLE `t_csjk_wificscrxx_rylx` (
  `id` varchar(36) NOT NULL COMMENT 'id',
  `rylxbm` varchar(255) DEFAULT NULL COMMENT '人员类型编码',
  `qklxbm` varchar(255) DEFAULT NULL COMMENT '前科类型编码',
  `gxsj` datetime DEFAULT NULL COMMENT '更新时间',
  `wfcscrxx_id` varchar(255) DEFAULT NULL COMMENT 'WiFi出入信息id',
  PRIMARY KEY (`id`),
  KEY `index_t_csjk_wificscrxx_rylx_wfcscrxx_id` (`wfcscrxx_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='wifi场所出入信息和重点人类别关系';




drop table if exists t_gwry_yjjl;
create table t_gwry_yjjl
(
   id      varchar(36) not null comment 'id',
   yjsj    datetime default NULL comment '预警时间',
   keyz    varchar(255) default NULL comment '判重标识',
   zdrxm   varchar(255) default NULL comment '重点人姓名，逗号隔开',
   csmc    varchar(255) default NULL comment '场所名称',
   zt      varchar(255) default NULL comment '状态，0：未处理，1：忽略，2：已处理',
   yjnr    varchar(255) default NULL comment '预警内容',
   primary key (id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='wifi预警记录';



drop table if exists t_gwry_yjxx;
create table t_gwry_yjxx
(
   id        varchar(255) not null comment 'id',
   mbid      varchar(255) default NULL comment '目标id',
   mblx      varchar(255) default NULL comment '目标类型',
   yj_id     varchar(255) default NULL comment '预警记录id',
   primary key (id),
   key `index_t_gwry_yjxx_yj_id` (yj_id)
)ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='预警相关信息';

